/* eslint-disable jsx-a11y/anchor-is-valid */
import NewPage from './pages/NewPage';
import React from 'react';


import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";


import logo1 from './images/image.jpg';
import logo2 from './images/imageb.jpg';
import logo3 from './images/imagec.jpg';
import './App.css';
import Navbar from './components/Navbar';

function App() {

  return (
    <>
      <Navbar>

      </Navbar>

      <Routes>
        <Route path="/">
          <About />
        </Route>
        <Route path="/">
          <Users />
        </Route>
        <Route path="/">
          <Home />
        </Route>
      </Routes>








      <div className="background">
        <div className="content">
          <h1>Welcome to My Website</h1>
          <p>Follow me on social media:</p>
          <a href="https://twitter.com/mytwitter" target="_blank" rel="noopener noreferrer">
            <i className="fab fa-twitter"></i>
          </a>
        </div>
      </div>

      <div
        style={{
          backgroundImage: `url(${logo1})`,
          backgroundSize: '1297px',
          backgroundAttachment: 'fixed',
          height: '100vh',
          position: 'relative',
          /* other CSS styles */
        }}
      >
        <h1>My component with inline background image</h1>
      </div>

      <div className="container2"
        style={{
          backgroundImage: `url(${logo2})`,
          backgroundSize: '1297px',
          backgroundAttachment: 'fixed',
          height: '100vh',
          position: 'relative',
          /* other CSS styles */
        }}
      >
        <img src="images/imageb.jpg" alt="" />
      </div>

      <div
        style={{
          backgroundImage: `url(${logo3})`,
          backgroundSize: '1297px',
          backgroundAttachment: 'fixed',
          height: '100vh',
          position: 'relative',
          /* other CSS styles */
        }}
      >
        <h1>My component with inline background image</h1>
      </div>





    </>
  );
};



export default App;
